import React, { useState, useRef, useEffect } from 'react';
import Dron from "../image/dron.jpeg";
import Camera from "../image/camera.jpg";
import Headphones from "../image/headphones.jpg";
import "../css/carousel.css";

export default function Carousel() {
  const [currentSlide, setCurrentSlide] = useState(1);
  const totalSlides = 12;

  useEffect(() => {
    const intervalId = setInterval(() => {
      // Move to the next slide
      setCurrentSlide((prevSlide) => (prevSlide % totalSlides) + 1);
    }, 3000); // Change slide every 3 seconds

    return () => clearInterval(intervalId); // Cleanup the interval on component unmount
  }, []);

  const handleRadioChange = (slideNumber) => {
    setCurrentSlide(slideNumber);
  };

  const renderInputs = () => {
    const inputs = [];

    for (let i = 1; i <= totalSlides; i++) {
      inputs.push(
        <React.Fragment key={i}>
          <input
            type="radio"
            name="slider"
            id={`s${i}`}
            checked={currentSlide === i}
            onChange={() => handleRadioChange(i)}
          />
          <label htmlFor={`s${i}`} id={`slide${i}`}>
            <img src={i % 2 === 0 ? Dron : Camera} alt="" />
          </label>
        </React.Fragment>
      );
    }

    return inputs;
  };

  return (
    <section id="slider">
    {renderInputs()}


      <label htmlFor="s1" id="slide1">
        <img src={Camera} alt="" />
      </label>
      <label htmlFor="s2" id="slide2">
        <img src={Dron} alt="" />
      </label>
      <label htmlFor="s3" id="slide3">
        <img src={Headphones} alt="" />
      </label>
      <label htmlFor="s4" id="slide4">
        <img src={Camera} alt="" />
      </label>
      <label htmlFor="s5" id="slide5">
        <img src={Dron} alt="" />
      </label>
    </section>
  );
}


